window.bookSummaryJSON = "<p>How far would you go to protect the ones you love? </p> <p>What would you sacrifice to kill the one you hate? </p> <p>Join Giovanni Vecchio and Beatrice De Novo as they travel to a hidden island on the far edge of China and seek the help of an ancient immortal court. Can they weave their way through the tangled web of centuries-old alliances and ruthless feuds to find what they've been looking for? Friends will be revealed, enemies will find them, and a dangerous secret will come to light. </p> <p><i>The Force of Wind</i> is the third book in the four-part Elemental Mysteries series. It is a paranormal mystery/romance for adult listeners.</p>"; 
